import React from 'react'
import { useSelector } from 'react-redux'

function Profile() {

  const { user } = useSelector(state => state.auth)
  if (user) {
    return (
      <div>
        {user.Email}
      </div>
    )
  } else {
    return (
      <></>
    )
  }
}

export default Profile
